import React, {Component} from 'react';
import { Grid, Cell } from "react-mdl";

class Contact extends Component {
    render() {
        return (
            <div className="contact-body">
                <Grid  className="contact-grid">
                    <Cell col={6}>
                        <h3></h3>
                        <img src="" alt=""/>
                        <p className="person-info">
                            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse ut sem nulla. Sed ut dignissim diam. Vestibulum auctor sollicitudin hendrerit. Morbi a tellus imperdiet lectus auctor iaculis. Fusce vestibulum dignissim justo ut tincidunt. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Integer ornare justo egestas, mollis lectus porta, sagittis lacus. Aenean pellentesque, neque vehicula maximus gravida, lorem libero mollis metus, in dignissim felis felis in lacus. Aenean tempor, nunc ut vulputate gravida, mi massa tempus odio, non convallis purus leo sed purus. Mauris volutpat tellus eget dolor lacinia, eu laoreet ipsum ultricies. In et lacus malesuada, dictum ante sed, blandit ligula. Morbi venenatis ante sit amet fermentum tempor. Maecenas massa dui, mattis sed consectetur non, sodales ut magna.
                        </p>
                    </Cell>


                    <Cell col={6}>part 2</Cell>
                </Grid>

            </div>
        );
    }
}

export default Contact;
